import "./BottomBar.css";
import { useNavigate } from "react-router-dom";

const BottomBar = () => {
    const navigate = useNavigate();
    const moveHome = (destination) => {
        navigate(`/Home`);
    }
    return (
        <div className="BOTTOM_BAR">
            <button className="BOTTOM_BAR_ICON FIRST_ICON" onClick={move('home')}></button>
            <button className="BOTTOM_BAR_ICON SECOND_ICON"></button>
            <button className="BOTTOM_BAR_ICON THIRD_ICON" onClick={move('my')}></button>
        </div>
    );
};

export default BottomBar;
